//aesthetica
import a from '../assets/aesthetica/a.png';
import b from '../assets/aesthetica/b.png';
import c from '../assets/aesthetica/c.png';
import d from '../assets/aesthetica/d.png';

//budget
import bgt1 from '../assets/budget/bgt1.png';
import bgt2 from '../assets/budget/bgt2.png';

 //lit&wine 
import wine1 from '../assets/litWine/wine1.png';
import wine2 from '../assets/litWine/wine2.png';
import wine3 from '../assets/litWine/wine3.png';

//notetaker 
import note1 from '../assets/notetaker/note1.png';
import note2 from '../assets/notetaker/note2.png';
import note3 from '../assets/notetaker/note3.png';

//PARTIE
import p1 from '../assets/partie/p1.png';
import p2 from '../assets/partie/p2.png';
import p3 from '../assets/partie/p3.png';
import p4 from '../assets/partie/p4.png';
import p5 from '../assets/partie/p5.png';

//workout planner 
import w1 from '../assets/workout/w1.png';
import w2 from '../assets/workout/w2.png';
import w3 from '../assets/workout/w3.png';
import w4 from '../assets/workout/w4.png';
import w5 from '../assets/workout/w5.png';

//work planner 
import wp1 from '../assets/workplanner/wp1.png';
import wp2 from '../assets/workplanner/wp2.png';




const aesthetica = {a, b, c, d}

const budget ={ bgt1, bgt2}

const litWine = {wine1, wine2, wine3}

const notetaker ={note1, note2, note3}

const partie ={p1, p2, p3, p4, p5}

const workout ={w1, w2, w3, w4, w5}

const work ={wp1, wp2}


export {aesthetica, budget, litWine, notetaker, partie, workout, work};
